import { configureStore } from '@reduxjs/toolkit';
import userReducer from '../Redux/userslice';
import { useReducer } from 'react';

const store = configureStore({
  reducer: {
    name: userReducer,
    email:userReducer,
    password:userReducer,

  },
});

export default store;
